import React,{useState} from 'react'
import Topbar from '../../components/Topbar'
import Login from '../Login/Login'
function Home() {
  const [userLogged,setUserLogged] = useState(false)
  const handleLogin = () =>{
    setUserLogged(true)
  }
  return (
    <div>
        <Topbar />
        {
          userLogged ? <> <h2> Welcome </h2> </> : <Login handleLogin={handleLogin} />
        }
    </div>
  )
}

export default Home
